import React from "react";
import sites from "./sites-info.json";
import Card from "./Card";
import "./App.css";

function AllSites() {
    return (
        <div className="App">
            <aside className="sidemenu"></aside>
            <p>THIS IS THE SITES PAGE</p>
            {sites.map((site)=><Card props={site} />)}
        </div>

    );
}

export default AllSites;
